import { Link } from 'react-router-dom';
import { getClubs } from '../../services/club-services';
import { Button } from '../Button';

function QuizDetails() {

    
    return (
        <>
            <div className='clubsList'>

                        <div className='eachClubBox'>
                            <div className="quiz">
                                <div className='left-cont'>
                                    <h1>Sports</h1>
                                    <p>Dummy details</p>
                                    <p className="title">Dummy quote</p>
                                </div>
                                <div className='right-cont'>
                                    <p className='btn-Practice'><Button buttonStyle = 'btn--primary' buttonStyle = 'btn--medium'>Practice</Button></p>
                                    <p className='btn-Single'><button>Single</button></p>
                                    <p className='btn-Double'><button>Double</button></p>
                                    <p className='btn-leader'><button>LeaderBoard</button></p>
                                </div>
                            </div>
                        </div>





                

            </div>
        </>
    );
}

export default QuizDetails;
